I Love Gina 2
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Gina Lynn and her very own production company, Gina Lynn Productions bring you the much anticipated sequel to I Love Gina. This one features Gina Lynn of course along with Lexington Steele, Spyder Jones, William Wacket and TJ Cummings plus a bonus scene with Gina and Angelina Valentine. All together there's over two hours of intensely hot action for all the Gina lovers out there.

